import "./Cell_styles.scss";
import React, { useState } from "react";

const Cell = () => {
  const [checked, setChecked] = useState(true);

  return (
    <div>
      <div
        className="cell"
        onClick={() => {
          setChecked(true);
        }}
      >
        <p className="cell_text">This is the cell text</p>
      </div>
    </div>
  );
};

export default Cell;
